const BgIcon8 = (props) => (
  <svg preserveAspectRatio="none" viewBox="0 0 48 48" fill="none" xmlns="http://www.w3.org/2000/svg" {...props}>
    <circle cx="24" cy="24" r="24" fill="#8D0B0B" />
  </svg>
);

const MemoBgIcon8 = memo(BgIcon8);
export { MemoBgIcon8 as BgIcon8 };
